import React from "react";
import '../style.css';
import Location from "./Location";

const Route = () => {
    return (
        <div className="route">
            <div>
                <button>Import</button><button>Export</button>

            </div>
            <Location icon=<i class="fa fa-location-dot"></i> where ="From City or port" />

        </div>
    );
}

export default Route;
